  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0106412 includes tows -
  plankton tows and biological data collected aboard NOAA Ship ALBATROSS IV, ENDEAVOR
  and OCEANUS during cruises AL9505, AL9506, AL9508, AL9605, AL9607, AL9701, AL9705,
  AL9707, AL9801, AL9806, AL9808, AL9901, AL9904, AL9906, EN261, EN263, EN265, EN276,
  EN278, EN282, EN320, OC275, OC298, OC300, OC302, OC317, OC319, OC322, OC336 and
  OC341 in the North Atlantic Ocean from 1995-02-11 to 1999-06-23. These data include
  TAXONOMIC CODE. The instruments used to collect these data include net. These data
  were collected by John Sibunka of National Oceanic and Atmospheric Administration
  and National Oceanic and Atmospheric Administration as part of GB. The Biological
  and Chemical Oceanography Data Management Office (BCO-DMO) submitted these data
  to NODC on 2013-04-23.nnThe following is the text of the abstract provided by BCO-DMO:nnGeorges
  Bank Fish Egg Data from Bongo Netsn1Standard Haul Factor: numerical factor (multiplier)
  used to standardize catches to be expressed as number caught per 10m2 of sea surface
  area. Most haul factors range from 1 to 10. The Standard Haul Factor has not been
  applied to the data reported here.n2Stages 6, 7, 8, & 9 are used only for Gadidae
  eggs.nAny questions, contact:nnJohn SibunkanNational Marine Fisheries Service, NEFCnSandy
  Hook Marine Lab.n74 Magruder RoadnHighlands, NJ 07732nnvoice: (732) 872-3064nfax:
